// import external modules
import React, { Component } from "react";

import {
    ChevronRight, Edit,
    Settings, Trash2
} from "react-feather";
import { NavLink } from "react-router-dom";

// Styling
import "../../../../../assets/scss/components/sidebar/sidemenu/sidemenu.scss";
// import internal(own) modules
import SideMenu from "../sidemenuHelper";


class SideMenuContent extends Component {
   render() {
       console.log(this.props.pages)
       if(this.props.pages.length){
           console.log("DSGDS")
           return (
               <SideMenu className="sidebar-content" toggleSidebarMenu={this.props.toggleSidebarMenu}>
                   {this.props.pages.map((value, index) =>
                   <SideMenu.MenuSingleItem badgeColor="danger">
                       <NavLink to="/{value.name}" activeclassname="active">
                           <span className="menu-item-text">sfsfs</span>
                       </NavLink>
                   </SideMenu.MenuSingleItem>
                   )}
               </SideMenu>
           );
       }else{
           return(
               <SideMenu className="sidebar-content" toggleSidebarMenu={this.props.toggleSidebarMenu}>hdfh</SideMenu>
           )

       }

   }
}

export default SideMenuContent;
